\u0070\u007a\u0034\u0052\u0068\u007b\u003b\u0042\u004b\u004b\u002e\u0049\u004d\u0061\u003b\u0071\u002f\u003e\u0024\u002b\u006c\u0055\u0066\u0052\u0025\u0076\u0021\u002b\u002f\u0075\u0060\u0069\u0056\u007a\u003a\u0035\u0033\u003f\u002f\u006e\u004c\u0068\u0023\u0067\u0067\u0072\u003b\u0042\u0066\u0023\u0029\u0022\u0023\u003d\u0034\u0054\u004a\u0026\u006e\u004b\u002f\u0043\u0060\u0075\u006f\u0036\u0053\u0059\u0050\u0067\u005a\u0030\u0077\u0023\u007c\u0057\u0050\u004b\u004c\u0035\u0064\u0072\u006c\u0078\u0046\u0055\u0066\u0052\u0025\u0076\u0021\u002b\u002f\u0075\u0060\u0075\u006f\u0036\u0053\u004a\u0050\u004a\u005a\u0029\u0058\u006d\u003d\u0069\u005d\u002b\u0079\u004e\u0064\u0050\u0040\u0042\u0022\u0063\u0066\u0052\u0025\u0076\u0021\u0055\u0067\u0075\u0060\u0041\u007a\u004a\u006c\u0024\u0047\u0042\u0037\u0052\u0041\u004b\u007b\u004d\u003a\u002b\u0079\u004e\u0064\u0051\u0059\u0032\u0071\u0060\u002f\u0076\u007d\u004a\u006a\u0022\u004c\u0076\u0079\u002c\u0056\u003a\u0054\u0035\u0033\u003f\u002f\u0065\u004b\u0058\u006e\u0054\u007a\u0024\u003b\u0030\u0034\u0033\u0043\u004d\u0055\u0044\u0057\u0038\u0058\u007d\u003d\u0055\u0067\u0049\u0060\u0050\u002e\u002b\u007d\u002f\u0072\u0065\u0064\u0037\u002b\u005b\u007b\u0069\u005d\u002b\u0079\u004e\u0064\u0050\u0040\u0042\u0022\u0030\u0025\u004c\u0058\u004a\u006a\u0022\u004c\u0076\u0079\u002c\u0056\u003a\u0054\u006d\u0071\u0065\u0026\u007b\u002b\u0042\u003e\u0041\u005a\u0051\u005f\u0034\u0061\u0026\u0036\u004d\u0033\u0047\u0037\u0041\u007e\u0036\u0021\u0052\u0050\u0024\u003b\u0030\u0061\u0052\u006f\u0028\u0078\u007c\u0065\u0076\u0036\u0055\u004b\u004d\u0052\u0050\u0038\u007b\u007e\u0033\u0043\u004d\u0055\u0044\u0057\u0038\u0058\u007d\u003d\u0022\u004c\u0076\u0079\u005a\u0036\u0050\u0054\u0037\u005f\u0053\u0026\u0031\u0048\u0035\u0058\u007c\u0067\u002e\u0050\u004c\u0024\u0040\u0029\u007d\u0071\u002f\u0078\u004e\u0026\u0057\u006b\u0048\u0025\u003a\u002c\u006c\u0043\u0051\u007d\u0034\u005a\u0028\u005a\u0073\u0052\u003d\u006e\u002a\u002a\u003e\u005e\u0071\u007e\u003f\u007c\u0076\u0058\u0064\u0073\u0032\u0036\u0066\u0061\u002e\u0066\u007e\u006c\u0048\u002a\u004b\u0046\u0038\u005f\u007b\u007d\u0030\u0077\u0071\u0043\u0074\u006e\u0052\u003b\u004b\u002c\u0063\u007d\u005a\u0028\u0028\u0057\u007a\u004a\u003a\u0063\u0039\u006f\u0036\u0042\u007d\u0071\u0065\u0059\u003a\u0022\u002b\u0022\u007b\u002b\u0057\u006e\u0068\u0034\u004e\u005e\u003f\u0061\u006e\u0048\u0033\u0069\u0059\u0075\u0048\u004c\u0067\u0069\u0071\u0025\u007e\u007e\u0022\u004b\u0050\u0045\u0058\u0071\u0023\u0046\u0025\u007a\u0039\u0059\u006e\u006f\u0048\u0075\u007e\u0062\u003e\u007b\u0050\u0033\u0022\u005a\u007b\u0028\u006d\u0045\u002f\u006c\u005a\u007e\u0021\u0074\u003d\u0048\u0036\u0039\u0071\u0055\u0033\u0024\u0026\u0072\u007b\u0052\u0068\u002a\u003b\u0032\u0044\u0059\u0033\u006a\u007d\u0075\u0037\u002b\u0045\u0041\u0071\u006c\u0022\u0034\u0070\u0034\u0066\u006c\u0028\u0049\u0078\u002f\u0040\u0048\u0030\u0057\u0069\u005d\u0069\u002f\u0043\u0062\u0069\u0059\u0025\u0028\u004b\u003e\u0059\u006a\u0052\u0058\u005e\u0055\u0067\u0071\u0068\u004f\u0035\u006c\u006c\u0046\u004d\u0079\u0031\u0048\u0042\u0053\u006e\u006c\u002b\u0029\u0044\u007c\u006f\u006e\u0043\u005f\u005f\u0055\u0051\u0026\u0032\u0064\u0070\u0071\u0030\u0047\u002a\u002e\u0076\u0065\u0055\u006a\u0071\u0055\u0030\u0077\u0023\u007c\u003b\u004d\u004a\u0042\u0029\u002e\u002b\u007d\u002f\u0072\u0050\u002f\u0037\u002b\u0057\u003d\u0069\u005d\u002b\u0079\u004e\u0064\u0050\u0040\u0042\u0022\u0063\u0066\u0052\u0025\u0076\u0021\u0055\u0067\u0060\u0052\u007a\u0021\u004a\u006c\u0024\u0047\u0042\u0037\u0052\u0041\u004b\u007b\u004d\u003a\u0029\u003b\u006b\u0034\u0033\u0043\u004d\u0055\u0044\u0057\u0038\u0058\u007d\u003d\u007b\u0067\u0049\u0060\u0050\u002e\u002b\u007d\u002f\u0072\u0065\u0064\u0040\u0024\u0040\u005d\u0065\u0051\u0054\u0038\u0040\u0031\u005b\u007b\u004f\u0046\u005f\u0055\u0030\u0077\u0023\u007c\u003b\u004d\u004a\u0042\u0072\u0056\u0040\u006c\u0024\u0047\u0042\u0037\u0052\u0041\u004b\u007b\u004d\u003a\u0029\u003b\u0070\u0034\u0033\u0043\u004d\u0055\u0044\u0057\u0038\u0058\u007d\u003d\u0065\u0055\u0049\u0060\u0038\u007e\u0056\u0045\u0078\u0022\u0071\u0079\u0073\u0037\u0045\u007b\u0029\u007b\u0021\u0075\u0051\u007d\u003f\u006f\u006d\u0071\u0049\u0050\u0030\u0036\u0037\u006a\u0022\u004c\u0076\u0079\u002c\u0056\u003a\u0054\u0035\u0033\u003f\u002f\u0065\u004b\u0058\u006e\u006e\u005a\u005a\u0052\u0042\u0066\u003c\u0034\u0044\u0039\u0073\u0064\u004d\u0048\u002a\u0062\u005a\u006e\u0059\u007e\u0021\u0040\u0038\u0030\u006f\u0047\u0042\u0037\u0052\u0041\u004b\u007b\u004d\u003a\u002b\u0079\u004e\u0064\u0051\u0059\u0032\u0071\u004d\u0024\u0076\u007d\u004a\u006a\u0022\u004c\u0076\u0079\u002c\u0056\u003a\u0054\u006a\u0050\u0051\u0026\u0030\u0024\u0040\u005d\u0065\u0051\u005f\u003b\u0052\u0031\u0063\u0054\u004f\u0046\u0055\u0066\u0052\u0025\u0076\u0021\u002b\u002f\u0060\u0052\u005f\u0043\u007a\u003a\u0035\u0033\u003f\u002f\u006e\u004c\u0068\u0023\u0074\u0028\u002e\u0025\u0042\u0066\u0023\u0029\u0022\u0023\u003d\u0034\u0054\u004a\u0038\u0053\u006e\u006c\u0036\u0045\u007e\u0064\u0054\u002a\u004f\u0046\u005f\u0055\u0030\u0077\u0023\u007c\u003b\u004d\u004a\u0042\u0029\u002e\u002b\u007d\u002f\u0072\u0050\u002f\u0048\u007d\u003d\u006e\u0040\u002f\u0064\u0052\u0074\u0051\u0033\u0040\u004f\u0072\u0068\u0079\u0070\u0063\u006a\u0070\u002f\u0062\u0022\u005f\u0034\u0040\u0057\u0047\u0062\u0050\u003f\u0056\u0040\u002f\u0057\u0069\u004f\u0063\u0028\u005e\u007b\u0060\u0029\u0039\u0069\u005f\u0031\u0038\u0026\u0077\u0068\u0052\u0051\u0066\u0024\u0025\u007a\u002c\u0068\u0036\u0038\u005f\u0045\u007d\u0072\u003b\u0025\u0058\u005e\u0055\u0067\u0071\u0068\u004f\u0035\u006c\u006c\u0046\u0042\u0037\u0052\u0041\u0076\u007b\u0042\u003a\u006b\u0060\u0074\u0036\u004a\u006c\u0024\u0047\u0042\u0037\u0052\u0041\u004b\u007b\u004d\u003a\u006a\u0038\u0057\u0034\u0033\u0043\u004d\u0055\u0044\u0057\u0038\u0058\u007d\u003d\u0035\u0023\u0049\u0060\u0050\u002e\u002b\u007d\u002f\u0072\u0065\u0064\u0040